import React from 'react'
import Quiz from './quiz';
import UserChoice from './user_choice';

export default function App(){
    var inputNum = -1;
    return(
        <div className='fullthing'>
            {(inputNum == -1) ? (
                <>
                <h1>hello</h1>
                
                <UserChoice />
                </>
            ) : (
                <Quiz />
            )}
            
        </div>
    )
}
